import React from 'react';
import './App.css';
import Footer from './components/footer/Footer';
import Header from './components/header/Header';
import Operators from './components/operators/Operators';

function App() {
    return (
      <div className='app__wrapper'>
        <Header />
        <Operators />
        <Footer />
      </div>
    );
}

export default App;
